(()=>{var domlist=document.getElementsByClassName("entry-content")[0].getElementsByTagName("img"),urls=[];if(domlist[0].srcset)for(dom of domlist){var max={size:0,num:0},temp=dom.srcset.split(/ | ,/),urlList=[],sizeList=[];for(i in temp)i%2?sizeList.push(+temp[i].split("w")[0]):urlList.push(temp[i]);for(i in sizeList)sizeList[i]>max.size&&(max.num=i);urls.push(urlList[max.num])}else for(dom of domlist)urls.push(dom.src);var title="eromanga-yoru-"+location.href.split("/")[3];savedojin.makedom(urls,title)})();